', 'ru', null), ('%updated 03.02.2013', '2013-02-03 16:13:41', '2017-07-13 03:17:58', '2399', 'de', null), ('', '2013-02-01 14:06:04', '2017-07-13 03:17:58', '2399', 'en', null), ('% updated on 15.03.2013.', '2013-03-15 21:32:04', '2017-07-13 03:17:58', '2399', 'est', null), ('', '2014-04-13 21:19:40', '2017-07-13 03:17:58', '2399', 'hu', null), ('', '2015-03-14 21:57:02', '2017-07-13 03:17:58', '2399', 'nl', null), ('', '2013-02-15 13:09:23', '2017-07-13 03:17:58', '2399', 'pl', null), ('', '2013-10-06 13:30:09', '2017-07-13 03:17:58', '2399', 'ru', null), ('% 7 Feb', '2015-03-12 16:15:39', '2017-07-13 03:17:58', '2399', 'sv', null), ('\\ (kann auch metaphorisch genutzt werden, um sich auf die Ebene von etwas skalierbaren zu beziehen – alles was Ebenen oder Abstufungen, Höhen und Tiefen hat: Wasserstand, Temperatur, Talent, Wut, usw.) %updated 03.02.2013', '2013-02-03 16:13:41', '2017-07-13 03:17:58', '2400', 'de', null), ('\\ (Can also be used metaphorically to refer to the level of anything scalable - anything that can have levels or degrees, highs and lows, water level, temperature, talent, anger, etc.)', '2013-02-01 19:36:48', '2017-07-13 03:17:58', '2400', 'en', null), ('% updated on 15.03.2013.', '2013-03-15 21:32:04', '2017-07-13 03:17:58', '2400', 'est', null), ('\\ (Használható képletesen is, bármilyen mérhető dologra, aminek szintje vagy foka lehet;  magasság, mélység , vízszint, hőmérséklet, tehetség, düh, stb.)', '2014-04-13 21:19:40', '2017-07-13 03:17:58', '2400', 'hu', null), ('\\ (Kan ook metaforisch worden gebruikt voor elk niveau van iets schaalbaars - alles met niveaus of graden, hoog of laag, waterniveau, temperatuur, talent, etc.)', '2015-03-19 16:37:14', '2017-07-13 03:17:58', '2400', 'nl', null), ('\\ (Może być użyte jako metafora w odniesieniu do poziomu rzeczy skalowalnych - wszystko co może mieć poziomy lub stopnie, poziom wody, temperatury, talentu, gniewu, itp.)', '2013-02-15 13:06:25', '2017-07-13 03:17:58', '2400', 'pl', null), ('(Может быть использовано метафорично для показа уровня чего-то измеримого - всего что имеет уровень или степень, вершины и низины, уровень воды, температура, способность, раздраженность и т.д)', '2013-09-18 14:53:17', '2017-07-13 03:17:58', '2400', 'ru', null), ('\\ (Can also be used metaphorically to refer to the level of anything scalable - anything that can have levels or degrees, highs and lows, water level, temperature, talent, anger, etc.)', '2013-02-07 13:35:07', '2017-07-13 03:17:58', '2400', 'sv', null), ('%updated 03.02.2013', '2013-02-03 16:13:41', '2017-07-13 03:17:58', '2401', 'de', null), ('', '2013-02-01 19:15:20', '2017-07-13 03:17:58', '2401', 'en', null), ('% updated on 15.03.2013.', '2013-03-15 21:32:04', '2017-07-13 03:17:58', '2401', 'est', null), ('', '2017-01-07 13:35:21', '2017-07-13 03:17:58', '2401', 'hu', null), ('', '2015-03-19 16:37:14', '2017-07-13 03:17:58', '2401', 'nl', null), ('', '2013-02-15 13:06:25', '2017-07-13 03:17:58', '2401', 'pl', null), ('', '2013-10-06 13:30:09', '2017-07-13 03:17:58', '2401', 'ru', null), ('% 7 Feb', '2013-02-07 13:30:30', '2017-07-13 03:17:58', '2401', 'sv', null), ('%updated 03.02.2013', '2013-02-03 16:13:41', '2017-07-13 03:17:58', '2402', 'de', null), ('', '2013-02-01 19:19:51', '2017-07-13 03:17:58', '2402', 'en', null), ('% updated on 15.03.2013.', '2013-03-15 21:32:04', '2017-07-13 03:17:58', '2402', 'est', null), ('', '2017-01-07 13:38:55', '2017-07-13 03:17:58', '2402', 'hu', null), ('', '2015-03-19 16:37:14', '2017-07-13 03:17:58', '2402', 'nl', null), ('', '2013-02-15 13:06:25', '2017-07-13 03:17:58', '2402', 'pl', null);
