_COMMENT', 'ptbr'), ('Noi am adunat fiecare cuvânt cât de bine noi am putut. Această sursă este plasat într-un indice după transcrierea IPA și dezvăluie sursa pentru fiecare cuvânt. De interes istoric, acest dicționar sa bazat inițial pe o listă inițială de aproximativ 500 de ', '2014-04-18 20:48:13', '2017-07-13 03:17:56', 'SOURCE_COMMENT', 'ron'), ('\\par Мы отследили первоисточники каждого слова насколько точно, насколько смогли. Первоисточники указаны субскриптом после фонетической транскрипции IPA и раскрывают происхождение каждого слова. Для справки, этот словарь базируется на первоначальном списк', '2014-12-07 12:42:11', '2017-07-13 03:17:56', 'SOURCE_COMMENT', 'ru'), ('\\par Vi har gett varje ord en källa så gott vi kan. Källan placeras efter IPA för ett ord, där den säger vart ordet härstammar ifrån. För historiskt intresse, så är den här ordboken baserad på en lista med ca 500 ord från Dr. Frommer i Mars, 2010. Allteft', '2013-03-16 15:39:23', '2017-07-13 03:17:56', 'SOURCE_COMMENT', 'sv'), ('% READ THIS (but you don\'t have to copy it, of course)% Different languages, different ways of sorting. I\'m not sure what Perl\'s performance is like so you may want to define own sorting \"properties\"% Seperated by whitespaces it takes several arguments% F', '2010-07-11 05:00:02', '2017-07-13 03:17:56', 'SOURCE_COMMENT', 'zhcn'), ('Avatar hry', '2011-01-29 16:02:25', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'cz'), ('Die Avatar Spiele', '2012-09-09 17:50:42', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'de'), ('the Avatar Games', '2010-03-16 06:33:05', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'en'), ('', '2010-09-10 17:36:15', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'eo'), ('los videojuegos de avatar', '2010-06-11 15:10:17', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'es'), ('Avatari m', '2017-06-09 08:53:46', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'est'), ('Avatar-pelit', '2010-07-27 13:49:18', '2017-07-13 03:17:56', 'SO_AVATAR_GAMES', 'fi'), ('the Avatar Game